export const followActionCreator = (userId: string) => ({
    type: actionsTypes.followUser,
    payload: userId,
});

export const unfollowActionCreator = (userId: string) => ({
    type: actionsTypes.unfollowUser,
    payload: userId,
});

export const setUsersActionCreator = (users: UserType[]) => ({
  type: actionsTypes.setUsers,
  payload: users,
})

const initialState = {
    users: [],
};

export const usersReducer = (state = initialState, action) => {
    switch (action.type) {
      case actionsTypes.setUsers: 
      return {
        ...state, users: [...state.users, ...action.payload]
      };
        case actionsTypes.followUser:
            return { 
              ...state, 
              users: state.users.map((user: UserType) => {
                if (user.id === action.payload) {
                  return {
                    ...user,
                    followed: true
                  }
                }
                return user
              }) 
            };


        case actionsTypes.unfollowUser:
          return { 
            ...state, 
            users: state.users.map((user: UserType) => {
              if (user.id === action.payload) {
                return {
                  ...user,
                  followed: false,
                }
              }
              return user
            }) 
          };

        default:
            return state;
    }
};
